import React, { Component } from 'react';

class wordDisplay extends React.Component {
    state = {
        synonims: []
    }
    componentDidMount() {
        fetch('https://api.datamuse.com/words?ml=glass')
        .then(res => res.json())
        .then((data) => {
          this.setState({ synonims: data })
          console.log(data)
        })
        .catch(console.log)
    }



    render (){
        return (
            <div> This is the word display element for the word {this.props.word} </div>
        );
    }
}
export default wordDisplay;
